import { createMuiTheme } from '@material-ui/core/styles';

export const theme = createMuiTheme({
  typography: {
    fontFamily: "\"GlacialIndifference\"",
   },
  palette: {
    primary: {
      main: '#0d253f',
      dark: '#080218',
      contrastText: '#000',
    },
    secondary: {
      main: '#01b4e4',
      contrastText: '#efeeee',
    },
    background: {
      default: "#efeeee"
    },
  },
  overrides: {
    MuiStepLabel: {
      color: '#080218',
        label: {
            color: '#080218',
            '&$active': {
                color: '#000',
            },
            '&$completed': {
              color: '#000',
          },
        },
    },
},
});
